シンティアム1000は、もっとも極端で高負荷な使用環境のもとで極めて優れたエンジン保護とエンジン性能を引き出すマルチグレードの超高性能化学合成油です。環境に配慮したプレミアム化学合成基油と先進の調整添加剤によって特に調合され、酸化防止性能に優れ、外気温の変化に関わらず安定した性能を発揮します。 <br><br>高温でのエンジン使用で起こりやすいオイルの高濃度化を最小限に抑えられ、堆積物の抑制に優れ、またエンジンの摩耗や損傷を最小限に食い止めます。触媒コンバーターや噴射コントロール装置に対応し、環境保護を重視して開発されたオイルです。<br><br>●容量：1リットル ●用途：4サイクルエンジン用（乗用車） ●ベースオイル：化学合成油 ●油種：FULL SYNTHETIC ●規格/粘度/他：10W40 A3/B3 SM/CF MB 229.1/ VW502/505 <br><br>4ストロークエンジン用（ガソリン・ディーゼル） <br><br>車検対応品<br><br>ケミカル系/エンジンオイル<tr><td colspan="2">
