ペトロナス MACH-5は、広範囲のフィールドテストとレース・ラリーのテストを基に開発され、厳しい使用条件下において卓越したエンジン保護性能を発揮するハイパフォーマンスエンジンオイルです。 <br><br>ロングドレイン使用や、過酷な使用条件において優れたエンジン保護性能を発揮します。ターボ・スーパーチャージャー搭載車やオイルクリアランスの広い高年式車両などに最適です。また、オイルシール保護性能・酸化安定性・熱安定性に優れます。<br><br>●容量：4リットル ●用途：4サイクルエンジン用（乗用車） ●ベースオイル：鉱物油 ●油種：MINERAL ●規格/粘度/他：20W50 A3/B3 SM/CF MB229.1/VW501.01/505.00<br><br>4ストロークエンジン用（ガソリン・ディーゼル）<br><br>車検対応品<br><br>ケミカル系/エンジンオイル<tr><td colspan="2">
